import React from 'react';
import { Grid, Paper, Avatar, TextField, FormControlLabel, Button, Typography, Link } from "@material-ui/core";
import DashboardOutlinedIcon from '@material-ui/icons/DashboardOutlined';
import Checkbox from '@material-ui/core/Checkbox';
import { NavLink } from 'react-router-dom';
import { FormHelperText } from '@material-ui/core';
import { Formik, Field, Form, ErrorMessage } from 'formik';
import * as Yup from 'yup';



const Login = () => {

    const paperStyle = { padding: 20, height: "55vh", width: 340, margin: "80px auto" }
    const avatarStyle = { backgroundColor: "#1c4c74" }
    const btnStyle = { margin: '8px 0' }
    return (
        <Grid>
            <Paper elevation={10} style={paperStyle}>
                <Grid align="center">
                    <Avatar style={avatarStyle}><DashboardOutlinedIcon /></Avatar>
                    <h2>Sign In</h2>
                </Grid>
                <Formik>
                    {(props) => (
                        <Form>
                            <TextField label='Username' placeholder='Enter your username..' fullWidth required />
                            <TextField label='Password' placeholder='Enter your password..' type='password' fullWidth required />
                            <FormControlLabel
                                control={
                                    <Checkbox

                                        name="checkedB"
                                        color="primary"
                                    />
                                }
                                label="Remember Me"
                            />
                            <Button type='submit' color='primary' style={btnStyle} fullWidth variant='contained'>Sign In</Button>
                        </Form>
                    )}
                </Formik>
                <Typography align='center'>
                    <Link href='#' >
                        Forgot Password ?
                    </Link>
                </Typography >
                <Typography style={{ marginLeft: 40 }}> Do you have an account ? {" "}
                    <NavLink to='/signup' >
                        Sign Up
                    </NavLink>
                </Typography>
            </Paper>
        </Grid>
    )
}
export default Login;
